import React from "react";
import Home from "./home1";

function Homelist({children,name}){
    if(children!==[])
    {
        return(<ul>
            {children.map((e)=>{return(<li>{e}</li>)})}
        </ul>)
    }
    else
    {
        return(<h5>No {name}</h5>)
    }
}
export default Homelist;
